"""# ***let's deal with outliers***
Similar to missing values, there are a few things that need done in order to deal with outliers:

1.Detect the outliers -Boxplots/histograms

2.Deal with outliers -Drop outliers? -Transform the data using log/ inverse /square root.
"""

dataset.shape

cont_vars = list(dataset.columns)[3:]
def outliers_visual(data):
    plt.figure(figsize=(15, 40))
    i = 0
    for col in cont_vars:
        i += 1
        plt.subplot(9, 4, i)
        plt.boxplot(data[col])
        plt.title('{} boxplot'.format(col))
       
    plt.show()

outliers_visual(dataset)

"""infant_deaths (per 1000 of population) has outliers around 1800. Mathematically unlikely they are having more infant deaths than actual infants. Likely a data collection error. We will drop outliers over 1000.

measles (number of reported cases per 1000) has possible outliers at 212k. Same explanation and course of action as above

under_five_deaths (per 1000 of population) has outliers of 2500. Same explantion and course of action as above

percentage_expenditure "as a percent of GDP" has outliers around 20k. Unlikely a country is spending 20,000% of their GDP on health, but a large portion of the data is over 300% of GDP, which also seems very high. Because of the range, we will take the log.

population and gdp outliers are likely correct as there are few very rich and highly populated countries. Obtaining the log of these values will be helpful and we can winsorize if needed afterwards

bmi has a distribution that does not make sense. A bmi over 40 is morbidly obese and somehow some countries recorded a mean of almost 90? That means there is a country (or multiple) with a such a large population of people that are shorter than 5'0" and weigh over 400 lbs. This variable may be dropped entirely.

status, while a categorical variable, many countries are not categorized correctly as France and Canada (plus about 6 others) are listed as "developing".
"""

dataset=dataset[dataset['infant deaths']<1000]
dataset=dataset[dataset['Measles ']<10000]
dataset=dataset[dataset['under-five deaths ']<100]
dataset=dataset[dataset['Alcohol']<17.5]
dataset=dataset[dataset[' HIV/AIDS']<15]
dataset=dataset[dataset['Life expectancy ']>40]
dataset=dataset[dataset['percentage expenditure']<12500]
dataset=dataset[dataset['Hepatitis B']>70]
dataset=dataset[dataset['Polio']>70]
dataset=dataset[dataset['Total expenditure']<14.0]
dataset=dataset[dataset['Diphtheria ']>40]
dataset=dataset[dataset[' thinness  1-19 years']<20]
dataset=dataset[dataset[' thinness 5-9 years']<20]
dataset=dataset[dataset['Income composition of resources']>0.0]
dataset=dataset[dataset['Schooling']>7]

outliers_visual(dataset)

